    return (
        <form>
            <div>
                <input placeholder={"Login"}></input>
            </div>
            <div>
                <input placeholder={"Password"}></input>
            </div>
            <div>
                <input type={"checkbox"}></input>
                    remeber me
                </div>
            <div>
                <button>Login</button>
            </div>
        </form>
    )
}

const ReduxLoginForm = reduxForm ({
    form: 'login',
    registrationForm: 'registration',
})(ContactForm)

const LoginPage = (props) => {
    return (
        <div>
            <h1>Login</h1>
            <ReduxLoginForm/>
        </div>
    )
}
export default LoginPage;
